import React from 'react'
import styled from 'styled-components'

function NotFound () {
  const Heading = styled.p`
    text-align: center;
    margin-top: 100px;
    font-size: 30px;
`
  return (
    <Heading>Page Not Found</Heading>
  )
}

export default NotFound
